Требования к моральному облику офицера

1. Отважен без запальчивости;

2. Тверд без  упрямства;

3. Требователен без придирчивости;

4. Справедлив без пристрастия;

5. Решителен без наглости;

6. Честен без похвалы;

7. Остроумен без язвительности;

8. Вежлив без угодливости;

9. Деятелен без ухищрения;

10. Уважителен без подобострастия;

11. Послушен без унижения;

12. Откровенен без вымысла;

13. Основателен без педантства;

14. Честолюбив без зависти;

15. Милосерден без корысти;

16. Гибок без пронырливости;

17. Скромен  без притворства;

18. Весел без легкомыслия;

19. Заботлив без понукания;

20. Осторожен без трусости.

А.В.Суворов

Я боюсь... - потерять что-то близкое и родное;
Я говорю... – что думаю);
Я ем... - шоколад;
Я знаю... - что у меня всё будет хорошо, хотя и писсемизлю постоянно;
Я люблю... – ночь с яркими звездами и всегда загадываю желания;
Я не люблю... - лицемерие;
Я пью... – все, кроме алкоголя;
Я ругаюсь... – редко,когда доведут;
Я смотрю... - большими глазами вперёд!Ведь от того куда мы смотрим-зависит то что мы видим;
Жизнь это... – прекрасно, хотя и не всегда просто;
Любовь это... – взаимно, в моем случае это идеал;
Смерть это... – страшно,хотя смерти я не боюсь...;
Если цветы, то – розы;
Если чай, то... – каркаде, фруктовый и зеленый;
Если музыка, то... - под настроения;
Если зима, то.. – снежная;
Если лето, то... – улетное;
Если осень, то... – золотая;
Если весна, то... –любовь!
Если отношения, то... – честные!
Если плакать, то... - от радости!
Если невозможно, то... - нужно искать другой выход или прокладывать дорогу!

Водолей - интересный, конечно, знак. Но, ..., постоянно гоняет на своей волне. Отвлечь его от Вселенских проблем может только разрыв Ядерной Бомбы и то, только в собственном сортире, пока он с милейшей улыбкой будет изучать ВЛИЯНИЕ ЛУНЫ НА ЖИЗНЬ НЕНЕЦКОГО НАРОДА, сидя на унитазе. Очень рассудителен по жизни, строит долгосрочные планы, проекты, увидев, что-то яркое и красивое, все к чертовой матери забывает и с головой бросается во все тяжкие. Не подлец, но дурака включать любит, исключительно, из детского желания послать вас на ... Свято, сука, верит в любовь, влюбившись, обязательно устроит драму. Опять же из-за своего ушлепного характера. Потрясающая способность культивировать трагедию на ровном месте. Пример: если Вы сели на недавно окрашенную скамейку, максимальная реакция - вспомнить всех до дедушкиного колена по матери, маляров, которые забыли сделать табличку:ОКРАШЕНО, но не Водолей. Этот нет, задолбает всех вплоть до Всевышнего, какого ... вообще, эта скамейка стоит в парке. Но не дай Вам Бог, улечить его в ошибке. Лучше сразу ложитесь в гроб. Хорошо если, только узнаете, про себя всю правду (исключительно на его взгляд) - считайте дешево отделались, может устроить и революцию, где нибудь в Зимбабве, чтобы все посчитали, что данная ошибка была частью стратегического плана по покорению МИРА. Мило, конечно, но не для слабонервных. Терпеть не может бытовуху, бурную деятельность проводит только для того, чтобы все отъебались и не мешали строить идеальный мир. Преданность идеалу, вторая характерная черта всех Водолеев. Становиться послушным, как слепой котенок... слюняв, как сербернар. Здесь надо быть очень осторожным. Водолей окружает себя идеалами. Идеалом может стать все, даже слипшиеся макароны, лишь бы в красивой тарелке. Сожрав макароны, первая мысль - пипец, нет гармонии. Это третья черта Водолея - стремление к гармонии. Как Вы думаете, легко ли нам жить, в этом не идеальном, не гармоничном, полном физиологических проблем мире? НЕТ!!! Поэтому, ждите потрясений и революций.
